import React from 'react';
import {Switch,Route, Link ,Router} from 'react-router-dom'
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter } from 'react-router-dom'
import Appointment from "./body";
import Footer from "./footer";
import Map from "./map";
import Profile from "./profile";



import './sidebar.css';
class SideNavPage extends React.Component {
    constructor(props) {
        super(props);
        this.state = {isToggle: true};
        this.handleClick = this.handleClick.bind(this);
      }

      handleClick(e) {
        this.setState({isToggle: !this.state.isToggle});
      }


  render() {
      return (
        <div className="container" id="j" >
        <BrowserRouter>
          <div className="row" >

        <div className="col-sm-2" id="lp"> 

        <div  style={{display: this.state.isToggle ? 'block': 'none'}}>  

        <div className="wrapper"> 

          <div className="sidebar" >

            <ul >
                <li><Link to="/footer"><i className="fas fa-home"></i>Home</Link></li>
                <li><Link to="/"><i className="fas fa-user"></i>Doctor</Link></li>
                <li><Link to="/about"><i className="fas fa-address-card"></i>About</Link></li>
                <li><Link to="/body"><i className="fas fa-project-diagram"></i>Appointment</Link></li>
                <li><Link to="/blogs"><i className="fas fa-blog"></i>Blogs</Link></li>
                <li><Link to="/contact"><i className="fas fa-address-book"></i>Contact</Link></li>
                <li><Link to="/map"><i className="fas fa-map-pin"></i>Map</Link></li>
                <li></li>
            </ul> 
            <div class="social_media">
              <Link to="/fb"><i className="fab fa-facebook-f"></i></Link>
              <Link to="/twit"><i className="fab fa-twitter"></i></Link>
              <Link to="/insta"><i className="fab fa-instagram"></i></Link>
            </div>
            </div>
            </div>
        </div>
        <div ><button className="btn btn-primary" onClick={this.handleClick}>
             <span className="spinner-border spinner-border-sm"></span>
             </button></div>

             </div>

           <div className="col-sm-9">
             <li className="nav-item" style={{left:"0px"}}>
               <div className="container p-3 my-3 border jumbotron"  style={{height:"auto"}} >welcomme!!!!

               <div>

                <Switch>
                <Route path="/body" component = {Appointment} /> 
                <Route path="/footer" component = {Footer} /> 
                <Route path="/map" component = {Map} /> 
                <Route path="/profile" component = {Profile} /> 


                </Switch>


                </div>
                </div>
             </li>
             </div>
             </div> 
             </BrowserRouter>
        </div>
      );
    }
  }

  export default SideNavPage;
